import React from 'react';

import './styles.css';

class Navbar extends React.Component {
    render(){

        return(
            <nav class="navbar navbar-light bg-light">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">Navbar</a>
                </div>
            </nav>)
    }
}

export default Navbar
